import css from '../filmCard/PositionsList.module.css';

export function PositionsList({ chord }) {
  console.log(chord.positions);
  <CreateFret string="3" fret="4" />;
}

function CreateFret({ string, fret }) {
  return (
    <table>
      <tr className={css.fret}>
        <td>{string === 1 ? 'X' : '0'}</td>
        <td>{string === 2 ? 'X' : '0'}</td>
        <td>{string === 3 ? 'X' : '0'}</td>
        <td>{string === 4 ? 'X' : '0'}</td>
        <td>{string === 5 ? 'X' : '0'}</td>
        <td>{string === 6 ? 'X' : '0'}</td>
      </tr>
    </table>
  );
}
